import './App.css';
import React,{Component} from "react";

export default class App extends Component{

    render() {
        return(
            <div className='main'>
                <div className="row">
                    <div className="col-xs-offset-2 col-xs-8">
                        <div className="page-header"><h2>React Router Demo</h2></div>
                    </div>
                </div>
            </div>
        )
    }
}
